PageViews_by_Date_1.query:
q = load "LightningPageViewWithUserEA";
q = filter q by date('TIMESTAMP_DERIVED_Year', 'TIMESTAMP_DERIVED_Month', 'TIMESTAMP_DERIVED_Day') in {{column(static_1.selection, ["Text3"]).asObject()}};
q = group q by ('PAGE_URL', 'TIMESTAMP_DERIVED_Year', 'TIMESTAMP_DERIVED_Month', 'TIMESTAMP_DERIVED_Day');
q = foreach q generate q.'PAGE_URL' as 'PAGE_URL', q.'TIMESTAMP_DERIVED_Year' as 'TIMESTAMP_DERIVED_Year', q.'TIMESTAMP_DERIVED_Month' as 'TIMESTAMP_DERIVED_Month', q.'TIMESTAMP_DERIVED_Day' as 'TIMESTAMP_DERIVED_Day', count(q) as 'A';
q = order q by ('PAGE_URL' asc, 'TIMESTAMP_DERIVED_Year' asc, 'TIMESTAMP_DERIVED_Month' asc, 'TIMESTAMP_DERIVED_Day' asc);
q = limit q 2000;

PageViews_by_URL_1.query:
q = load "LightningPageViewWithUserEA";
q = filter q by date('TIMESTAMP_DERIVED_Year', 'TIMESTAMP_DERIVED_Month', 'TIMESTAMP_DERIVED_Day') in {{column(static_1.selection, ["Text3"]).asObject()}};
