PageViews_by_User_1.query:
q = load "LightningPageViewWithUserEA";
q = filter q by date('TIMESTAMP_DERIVED_Year', 'TIMESTAMP_DERIVED_Month', 'TIMESTAMP_DERIVED_Day') in {{column(static_1.selection, ["Text3"]).asObject()}};
q = group q by ('user.Name', 'PAGE_URL');
q = foreach q generate q.'user.Name' as 'user.Name', q.'PAGE_URL' as 'PAGE_URL', count(q) as 'A';
q = order q by 'A' desc;
q = limit q 2000;
